    false,nt"url": null,nt"notes": "This EnviroAtlas dataset contains Land
    Cover data by Wetness Index for each Watershed Boundary Dataset (WBD) 12-Digit Hydrologic
    Unit Code (HUC-12) of the conterminous United States based on the National Land
    Cover Database (NLCD) from 2006, the December 30, 2009 Soil Survey Geographic (SSURGO)
    Database, and the USDA's Cropland Data Layer (CDL) data from 2010. The dataset includes
    the percentages of each HUC-12 belonging to several land cover groups that are on
    land with a Wetness Index greater than 550 (WET550). This dataset was produced by
    Tetra Tech, Inc. to support research and online mapping activities related to EnviroAtlas.
    EnviroAtlas (https://www.epa.gov/enviroatlas) allows the user to interact with a
    web-based, easy-to-use, mapping application to view and analyze multiple ecosystem
    services for the contiguous United States. The dataset is available as downloadable
    data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas) or as an EnviroAtlas map
    service. Additional descriptive information about each attribute in this dataset
    can be found in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).",nt"license_title":
